import "./App.css";
import React, { useState } from "react";

function App() {
  const [item, setItemList] = useState();

  const inputItem = (e) => {
    setItemList(e.target.value);
  };

  return (
    <div className="App">
      <h1> ToDo List </h1>
      <div>
        <input type="text" placeholder="add a item" onChange={inputItem} />
        <button>Add item</button>
      </div>

      <div>
        <ol>
          <li>{item}</li>
        </ol>
      </div>
    </div>
  );
}

export default App;
